Doomsday Preppers is an American reality television series that airs on the National Geographic Channel. Wise Food Storage Company and the United States Gold Bureau are official sponsors of the show.



Premise:
----------
The program profiles various survivalists, or &quot;preppers,&quot; preparing for the end of civilization. The series interviews people who are preparing to survive the various circumstances through which life as we know it might come to an end, including economic collapse, societal collapse, electromagnetic pulse, terrorist acts, nuclear incidents, fuel shortages, war, pandemics, geomagnetic reversal, etc. The interviews detail the actions that the preppers have taken, and end with an expert analysis and recommendations for improvements. Casting for the first season began September 2011. Casting for a second season began April 2012.




